	add("calfflesh", "{\"term\":\"calfflesh\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\", \"Dutch\"], \"text\":\"From Middle english (1100-1500) \u0027calfflesch\u0027 equivalent to {{compound|calf|flesh|lang\u003den}}. Cognate with Dutch \u0027kalfsvlees\u0027 (veal) German \u0027kalbfleisch\u0027 (veal)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The meat or flesh of a calf; veal\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1875\u0027\u0027, William M\u0027Combie, \u0027Cattle and cattle-breeders\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The calf should be allowed to suckle or to be fed from the pail for six or eight months. It has then strength to stand weaning, and, if properly cared for, will not be checked in its growth, and it will retain the good \u0027\u0027calfflesh\u0027\u0027 it has put on\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, Mark Lemon, Henry Mayhew, Tom Taylor, \u0027Punch\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"and also very often eat man beefsteaks or \u0027\u0027calfflesh\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, Thomas Walley, \u0027A practical guide to meat inspection\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Calf flesh\u0027\u0027 possesses a distinctive odour. While it is, by some manufacturers, largely substituted for chicken in the manufacture of ham, chicken, and tongue, other substitutions for veal are rarely practised\", \"priority\":7}]}, \"synonyms\":{}}");

