	add("calibre", "{\"term\":\"calibre\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"From French \u0027calibre|lang\u003dfr\u0027 () from Italian \u0027calibro\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Diameter of the bore of a firearm, typically measured between opposite lands\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The diameter of round or cylindrical body, as of a bullet, a projectile, or a column\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A nominal name for a cartridge type, which may not exactly indicate its true size and may include other measurements such as cartridge length or black powder capacity. Eg 7.62×39 or 38.40\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Unit of measure used to express the length of the bore of a weapon. The number of calibres is determined by dividing the length of the bore of the weapon, from the breech face of the tube to the muzzle, by the diameter of its bore. A gun tube the bore of which is 40 feet (480 inches) long and 12 inches in diameter is said to be 40 calibers long\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Relative size, importance, magnitude\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Capacity or compass of mind\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Degree of importance or station in society\", \"priority\":7}]}, \"synonyms\":{}}");

	add("caliche", "{\"term\":\"caliche\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Spanish\", \"Latin\"], \"text\":\"From Spanish from Latin \u0027calx\u0027 (pebble) compare \u0027chalk\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A crude form of sodium nitrate from South America; used as a fertilizer\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A layer of hard clay subsoil or sedimentary rock; hardpan\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1929\u0027\u0027, US Bureau of Chemistry and Soils, \u0027Soil Survey of Potter County, Texas\u0027, [http://books.google.com.au/books?id\u003diuzwAAAAMAAJ\u0026amp;pg\u003dPA44\u0026amp;dq\u003d%22caliche%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d_DETU7_7JIehkAWE5oDQCw\u0026amp;redir_esc\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caliche%22\u0026amp;f\u003dfalse page 44\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"According to local well drillers, in wells drilled on the high plains a few hundred feet back from the \u0027\u0027caliche\u0027\u0027 escarpment or in other locations on the high plains in this area no hard \u0027\u0027caliche\u0027\u0027 or white layer, such as would characterize a soft layer of high lime-carbonate content, is generally reached at a depth corresponding to the elevation of the \u0027\u0027caliche\u0027\u0027 escarpment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Julie Behrend Weinberg, \u0027Growing Food In the High Desert Country\u0027, [http://books.google.com.au/books?id\u003dJIm4GuTmzcwC\u0026amp;pg\u003dPA17\u0026amp;dq\u003d%22caliche%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d_DETU7_7JIehkAWE5oDQCw\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caliche%22\u0026amp;f\u003dfalse page 17\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Having a layer of \u0027\u0027caliche\u0027\u0027 at depths of 16 inches and less really puts a damper on the garden site. The \u0027\u0027caliche\u0027\u0027 does not allow roots to penetrate it (tree roots often take 10 years to break through a caliche layer) nor does this mineral allow water to drain\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Hüseyin Yalçin, Ömer Bozkaya, \u0027Chapter 7: Sepiolite-Palygorskite Occurrences in Turkey\u0027, Arieh Singer, Emilio Galan (editors), \u0027Developments in Palygorskite-Sepiolite Research\u0027, [http://books.google.com.au/books?id\u003dm846JpSYNG0C\u0026amp;pg\u003dPA186\u0026amp;dq\u003d%22caliche%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d_DETU7_7JIehkAWE5oDQCw\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22caliche%22\u0026amp;f\u003dfalse page 186\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Caliche\u0027\u0027 in various forms, namely powdery, nodule, tube, fracture-infill, laminar crust, hard laminated crust (hardpan) and pisolitic crust, is widespread in the Mersin area in southern Turkey (Eren et al., 2008; Kadir and Eren, 2008\", \"priority\":11}]}, \"synonyms\":{}}");

