	add("calipee", "{\"term\":\"calipee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A food of the yellowish material found inside the lower half of a turtle\u0027s carapace (shell\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The tortoise—as the alderman of Bristol, well learned in eating, knows by much experience—besides the delicious calipash and \u0027\u0027calipee\u0027\u0027, contains many different kinds of food\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1847\u0027\u0027 Thackeray Vanity Fair chapter XXV\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Dobbin helped him to it; for the lady of the house, before whom the tureen was placed, was so ignorant of the contents that she was going to help Mr. Sedley without bestowing upon him either calipash or \u0027\u0027calipee\", \"priority\":4}]}, \"synonyms\":{}}");

	add("calipers", "{\"term\":\"calipers\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A corruption of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device used to measure thickness between two surfaces, especially for small or precise measurements\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, \u0027s:Heart of Heart of Darkness\u0027, section I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;Good, good for there,\u0026quot; he mumbled, and then with a certain eagerness asked me whether I would let him measure my head. Rather surprised, I said Yes, when he produced a thing like \u0027\u0027calipers\u0027\u0027 and got the dimensions back and front and every way, taking notes carefully\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"UK) A metal (orthopedic) leg support, US: leg braces\", \"priority\":4}]}, \"synonyms\":{}}");

