	add("calisthenics", "{\"term\":\"calisthenics\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027κάλλος\u0027 (beauty) + \u0027σθένος\u0027 (strength)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gymnastic exercises, especially morning exercises, done to keep one\u0027s body healthy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A system of such exercises\", \"priority\":2}]}, \"synonyms\":{}}");

	add("caliver", "{\"term\":\"caliver\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Variant of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A type of light musket\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That done, running out into the streets, with a crosse-bow in one hand, and a \u0027\u0027caliver\u0027\u0027 in the other, at two shoots, slew the two first Turks that came next to his gates\", \"priority\":2}]}, \"synonyms\":{}}");

	add("calla", "{\"term\":\"calla\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A marsh plant native to cooler areas throughout the northern hemisphere, having pale green flowers in a white spathe\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The calla lily\", \"priority\":2}]}, \"synonyms\":{}}");

	add("callback", "{\"term\":\"callback\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|call|back|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The return of a situation to a previous position or state\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A return telephone or radio call; especially one made automatically to authenticate a logon to a computer network\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, James M. Lepkowski, ‎Clyde Tucker, ‎J. Michael Brick, \u0027Advances in Telephone Survey Methodology\u0027 (page 318\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For example, multiple \u0027\u0027callbacks\u0027\u0027 might be made to a nonanswered number to increase the response rate\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A product recall because of a defect or safety concern\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A function pointer passed to another function that the latter can call for notification purposes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a follow-up audition (casting\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a joke which references an earlier joke in the same routin\", \"priority\":8}]}, \"synonyms\":{}}");

	add("callee", "{\"term\":\"callee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|call|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The person who is called by the caller (on the telephone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A function called by another\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, w:Gerald Jay Gerald Jay Sussman and w:Guy L. Steele Guy L. Steele, Jr., \u0027s:Scheme: An Interpreter for Extended Lambda Scheme: An Interpreter for Extended Lambda Calculus\u0027, w:MIT Computer Science and Artificial Intelligence MIT AI Lab, page s:Scheme: An Interpreter for Extended Lambda Calculus/Section 24\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The interpreter must provide for correctly resuming the caller when the \u0027\u0027callee\u0027\u0027 has returned its value\", \"priority\":4}]}, \"synonyms\":{}}");

	add("calligram", "{\"term\":\"calligram\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word, phrase or longer text in which the typeface or the layout has some special significanc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A signature made from interwoven Arabic words, or interwoven Arabic words in the shape of the thing describedImage:Tugra Mahmuds right|frame|The stylized signature of Sultan Mahmud II of the Ottoman Empire was written in an expressive calligraphy. It reads \u0027Mahmud Khan son of Abdulhamid is forever victorious\", \"priority\":2}]}, \"synonyms\":{}}");

	add("calligrapher", "{\"term\":\"calligrapher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|calligraphy|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"one who practices calligraphy\", \"priority\":1}]}, \"synonyms\":{}}");

	add("calligraphy", "{\"term\":\"calligraphy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027calligraphie\u0027 from Ancient greek (to 1453) \u0027καλλιγραφία\u0027 (pretty writing) from \u0027κάλλος\u0027 (beauty) + \u0027γράφω\u0027 (to draw)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The art or practice of writing letters and words in a decorative style; the letters and words so written\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1981\u0027\u0027, Wayne E. Begley, \u00272: The Symbolic Role of \u0027\u0027Calligraphy\u0027\u0027 on Three Imperial Mosques of Shāh Jahān\u0027, Joanna Gottfried Williams (editor), \u0027Kalādarśana: American Studies in the Art of India\u0027, [http://books.google.com.au/books?id\u003d-qoeAAAAIAAJ\u0026amp;pg\u003dPR35\u0026amp;dq\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d6EeuU_nEJoSvlQW15IDIAQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;f\u003dfalse page 7\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"This paper will explore the role of \u0027\u0027calligraphy\u0027\u0027 on three royal mosques built during the reign of the Mughal emperor Shah Jahan (1628-1658\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Seyyed Hossein Nasr, \u0027Islamic Art and Spirituality\u0027, [http://books.google.com.au/books?id\u003dH5PZli-7V9EC\u0026amp;pg\u003dPA27\u0026amp;dq\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d6EeuU_nEJoSvlQW15IDIAQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;f\u003dfalse page 27\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There is, however, a temporal separation between the earthly crystallization of Quranic \u0027\u0027calligraphy\u0027\u0027 and the advent of the Quranic revelation\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Leslie Cabarga, \u0027Logo, Font \u0026amp; Lettering Bible\u0027, [http://books.google.com.au/books?id\u003d469vTMYFOUMC\u0026amp;pg\u003dPA78\u0026amp;dq\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d6EeuU_nEJoSvlQW15IDIAQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;f\u003dfalse page 78\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Calligraphy\u0027\u0027, however, can seem like a live concert recording with a shallow, raw sound and awkward \u0026quot;accidentals.\u0026quot; But \u0027\u0027calligraphy\u0027\u0027 has grown on me, and a distinction must be made between the calligraphy of high school diplomas and that of experts whose work is often breathtakingly beautiful\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Any such style of decorative writing\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A document written in decorative style\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Diana J, Mukpo, Carolyn Rose Gimian (editors), ‎Chogyam Trungpa, \u0027The Collected Works of Chogyam Trungpa\u0027, Volume 7, [http://books.google.com.au/books?id\u003d172yMBZKvpEC\u0026amp;pg\u003dPA169\u0026amp;dq\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d6EeuU_nEJoSvlQW15IDIAQ\u0026amp;redir_esc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22calligraphy%22%7C%22calligraphies%22\u0026amp;f\u003dfalse page 169\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Only a small number of Trungpa Rinpoche\u0027s \u0027\u0027calligraphies\u0027\u0027 have been reproduced heretofore, some in very limited editions\", \"priority\":15}]}, \"synonyms\":{}}");

	add("calliope", "{\"term\":\"calliope\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) \u0027καλλιόπη\u0027 (w:calliope) from \u0027καλός\u0027 (beautiful) + \u0027ὄψ\u0027 (voice)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A musical organ, consisting of steam whistles played with a keyboard. Often used with merry-go-rounds\", \"priority\":1}]}, \"synonyms\":{}}");

