	add("calomel", "{\"term\":\"calomel\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027calomel\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"mercurous chloride Hg\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt;Cl\u0026lt;sub\u0026gt;2\u0026lt;/sub\u0026gt\", \"priority\":1}]}, \"synonyms\":{}}");

	add("caloric", "{\"term\":\"caloric\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027calorique\u0027 coined by French chemist w:Antoine Lavoisier|Antoine Lavoisier, from Latin {{lena}} \u0027calor|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the hypothetical medium of hea\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Caloric\u0027\u0027 expands all bodies\", \"priority\":2}]}, \"synonyms\":{}}");

	add("calorie", "{\"term\":\"calorie\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027calorie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"physics and chemistry, obsolete\u0027) The gram calorie or small calorie, a non-SI unit of energy, equivalent to approximately 4.2 joules. This unit was widely used in chemistry and physics, being the amount of energy needed to raise the temperature of 1 gram of water by 1\u0026amp;nbsp;°C\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Kilogram calorie or large calorie. A unit of energy 1000 times larger than the gram calorie. It is equivalent to the gram kilocalorie, approximately 4.2 kilojoules\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/international/science-and-technology/21580133-how-microbes-promote-liver-cancer-overweight-punch-gut A punch in the passage\u003dMostly, the microbiome is beneficial. It helps with digestion and enables people to extract a lot more \u0027\u0027calories\u0027\u0027 from their food than would otherwise be possible. Research over the past few years, however, has implicated it in diseases from atherosclerosis to asthma to autism\", \"priority\":3}]}, \"synonyms\":{}}");

