	add("calorimeter", "{\"term\":\"calorimeter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|calorie|meter|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An apparatus for measuring the heat generated or absorbed by either a chemical reaction, change of phase or some other physical change\", \"priority\":1}]}, \"synonyms\":{}}");

	add("calotte", "{\"term\":\"calotte\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old french (842-ca. 1400)\", \"old high german (ca. 750-1050)\"], \"text\":\"French \u0027calotte\u0027 diminutive of \u0027calot\u0027 from \u0027écale\u0027 (husk, shell (of a nut)) (due to similar shape and closely fitting the head), from Old french (842-ca. 1400) \u0027escale\u0027 from Old high german (ca. 750-1050) \u0027scāla\u0027 (cognate to English \u0027\u0027 . Alternatively, may be related to Greek \u0027\u0027 (English \u0027calyptra\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a skullcap worn by Roman Catholic priest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The vertical central area of the crown of a bird\u0027s head\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A round cavity or depression, in the form of a cup or cap, lathed and plastered; used to diminish the rise or elevation of a moderate chapel, alcove, etc. which would otherwise be too high for other pieces of the apartment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The upper (superior) or lower (inferior) half of the globe of the eye\", \"priority\":4}]}, \"synonyms\":{}}");

