	add("calque", "{\"term\":\"calque\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Italian\"], \"text\":\"From French \u0027calque\u0027 (calque/loan translation) from French \u0027calquer\u0027 (to trace) from Italian \u0027calcare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word or phrase in a language formed by word-for-word or morpheme-by-morpheme translation of a word in another language.:: \u0027The word \u0026quot;watershed\u0026quot; is a \u0027\u0027calque\u0027\u0027 of the German \u0026quot;Wasserscheide\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

