	add("caltrop", "{\"term\":\"caltrop\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From the Latin \u0027calcitrapa\u0027 (thistle)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, metal object with spikes arranged so that, when thrown onto the ground, one always faces up as a threat to foot soldiers and horses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1858\u0027\u0027, \u0027The journal of the British Archaeological Association\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"her father, the emperor Alexius, who reigned AD 1081-1118, ordered \u0027\u0027caltrops\u0027\u0027 to be cast in front of his archers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1954\u0027\u0027, Joseph Needham, Ling Wang, \u0027Science and civilisation in China\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"By Sung times, several different types of \u0027\u0027caltrops\u0027\u0027 had been developed. As in earlier times, both caltrops could be made from both wood and iron\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Alan Vick, \u0027Aerospace operations in urban environments: exploring new concepts\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Caltrops\u0027\u0027, tetrahedrons, and similar devices are designed to puncture vehicle tires or limit foot traffic. The standard design has four points\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The same object represented as a heraldic charge\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The starthistle, a plant with sharp thorns\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any of a number of flowering plants in the family Zygophyllaceae, including several members of the genus and the species \u0027Tribulus terrestris\u0027, native to warm temperate and tropical regions\", \"priority\":10}]}, \"synonyms\":{}}");

	add("calumba", "{\"term\":\"calumba\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From its native name in Mozambique.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The bitter root of a plant (), indigenous to Mozambique, and used as a tonic and antiseptic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("calumet", "{\"term\":\"calumet\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From a Norman variant of Old french (842-ca. 1400) \u0027chalumeau\u0027 (imported to Canada with Norman colonists), from Latin \u0027calamellus\u0027 diminutive of \u0027calamus\u0027 () from Ancient greek (to 1453) \u0027κάλαμος\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A clay tobacco-pipe used by American Indians, especially as a symbol of truce or peace\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027: THE \u0027\u0027CALUMET\u0027\u0027 OF PEACE. He offered a cigarette to the professor and took one himself. — James Joyce, \u0027Ulysses\", \"priority\":2}]}, \"synonyms\":{}}");

	add("calumny", "{\"term\":\"calumny\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"Middle french (ca. 1400-1600) \u0027calomnie\u0027 from Latin \u0027calumnia\u0027 (slander) perhaps from \u0027calvor\u0027 (i deceive)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A falsification or misrepresentation intended to disparage or discredit another\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Accusations of abuse were pure extortive \u0027\u0027calumny\u0027\u0027 in a malicious bid to make money\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"False charges brought about to tarnish another\u0027s reputation or standing\", \"priority\":3}]}, \"synonyms\":{}}");

	add("calvinball", "{\"term\":\"calvinball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|Calvin|ball|lang\u003den}}. From a fictional game without rules, played in the comic strip \u0027w:Calvin and Hobbes|Calvin and Hobbes\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A game without rules\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027 June 17, Wayne Lockwood, \u0026quot;Nobody without health insurance is a slacker or a loser\u0026quot;, [http://www.highbeam.com/doc/1G1-18399217.html Knight-Ridder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And every time I would play serious tackle Nerf \u0027\u0027Calvinball\u0027\u0027 out in the park somewhere, it played over and over in the back of my mind -- what would I do if I broke an arm\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Chris Glaser, \u0027Unleashed\u0027, \u0027The Wit and Wisdom of Calvin the Dog\u0027, Westminster John Knox Press, ISBN 0664221165, page 7\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"At first my humans very much disliked it when I played croquet with them\u0027...\u0027. But eventually they decided to accept my participation, and renamed the game “\u0027\u0027Calvinball\u0027\u0027,” after the game of some comic book character\u0026lt;!--...--\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027 March–April, Bret Rappaport and Joni Green, “\u0027\u0027Calvinball\u0027\u0027 Cannot Be Played on This Court: The Sanctity of Auction Procedures in Bankruptcy”, \u0027Journal of Bankruptcy Law and Practice\u0027, volume 11, pages 189–21\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027The Grate Book of Moo\u0027, Church of MOO, Lulu.com (publisher), ISBN 1411641671, page ccclvi\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"They are required to play the game of Nomic, in some form, or alternatively, the games \u0027\u0027Calvinball\u0027\u0027 or Mao, which are basically the same\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Cathy Yardley, \u0027Will Write for Shoes\u0027, \u0027How to Write a Chick Lit Novel\u0027, St. Martin\u0027s Press, ISBN 0312358997, page 14\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Chick Lit, and pretty much all of publishing, plays a lot like \u0027\u0027Calvinball\u0027\u0027. There aren’t any rules\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, D. C. Simpson, \u0027Prehistrionics\u0027, \u0027Ozy and Millie, 1997-2000\u0027, Lulu.com (publisher), ISBN 1847287735, page 7\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"“House rules parcheesi” is distinct from “\u0027\u0027Calvinball\u0027\u0027” in that the latter has no set rules, whereas the former seems to have very specific rules, which are never divulged in the strip, under any circumstances\", \"priority\":12}]}, \"synonyms\":{}}");

	add("calvinism", "{\"term\":\"calvinism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027calvinisme\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The Christian religious tradition based upon the doctrines and forms of Christian practice of several Protestant reformers, especially , in contrast to Catholicism, Lutheranism, Anabaptism, and Arminianism.One distinctive of the system is its Augustinian doctrine of predestination, which teaches that God has elected some for salvation, apart from anything they do or believe\", \"priority\":1}]}, \"synonyms\":{}}");

